function User(id,lastToken,expired) {
    this.id = id;
    this.lastToken = lastToken;
    this.expired = expired;
}
exports.User = User;

function Post(id,owner_id,date,post_type,text) {
    this.id = id;
    this.ownerId = owner_id;
    this.date = date;
    this.postType = post_type;
    this.text = text;
}
exports.Post = Post;

function VKError(text) {
    this.text = text;
}

exports.VKError = VKError;